import About from './components/about';
import './App.css';
import {BrowserRouter,Switch,Route,Redirect} from "react-router";

function App() {
  return (
    <BrowserRouter>





    <Switch>
    <Route exact path='/about' component={About}/>

    <Redirect to='/about'/>
    </Switch>



    </BrowserRouter>
  );
}

export default App;
